import React, {Component} from "react";
import PicTag from "../../Helpers/Global/PicTag";
import "./SpeakerCard.css";
class SpeakerCard extends Component {

    ReadBioLinkClickHandler(event) {
        event.preventDefault();
        this.props.clicked;
    }
    //  ReadBioLinkClickHandler = event =>{
        
    //   // this.props.clicked;
       
    //   //  return   
    //   var x = 1;
    //     x = 2;
    //      this.props.clicked;
    //    event.preventDefault(); 
    //    return x;
    // }

    render(){
    let imgData =  this.props.imgData;

   
  //  console.log(imgData.imgMin1799)
    return(
    <div data-grid={this.props.dataColCount} className="contentpanel-div row1 mrow1" data-index="1" data-orderposition="1">
        <div className="m-content-placement-item f-size-medium f-precise-click ">
            <div className="relative width-10 height-10 contentpanel-content bg-white ">
                <PicTag mw1779={imgData.imgMin1799} 
                        mw1400={imgData.imgMin1399} 
                        mw1084 ={imgData.imgMin1084} 
                        mw768={imgData.imgMin768} 
                        mw540={imgData.imgMin540} 
                        mw0={imgData.imgMin0}> 
                </PicTag>
                <div className="text-content pl-1 pr-1 pb-0 xs-pb-0 pt-1">
                    <h3 className="c-heading-5 fw-6 pt-0 pb-0 content-title" >{this.props.title}</h3>
                    <h4 className="c-paragraph-3 pt-1 pb-0 content-subtitle" >{this.props.subTitle} </h4>
                    <a  onClick={this.ReadBioLinkClickHandler} href="#" className="c-call-to-action f-lightweight c-glyph open-speaker-popup" 
                        ><span>{this.props.linkText}</span> 
                    </a>
                </div>
            </div>
        </div>
    </div>  )
}
}
export default SpeakerCard;
